export default styled.div`
	height: 100%;
	width: 90vw;
	background-color: #1a1a1a;
	padding: 0;
	margin-left: auto;
	margin-right: auto;
	color: white;
	font-family: 'Cuprum', sans-serif;

	a {
		color: white;
